			shellScript = "# Sets the target folders and the final framework product.\n# 如果工程名称和Framework的Target名称不一样的话，要自定义FMKNAME\n# 例如: FMK_NAME = \"MyFramework\"\nFMK_NAME=${PROJECT_NAME}_sdk\n# Install dir will be the final output to the framework.\n# The following line create it in the root folder of the current project.\nINSTALL_DIR=${SRCROOT}/../Products/${CONFIGURATION}/${FMK_NAME}.framework\n# Working dir will be deleted after the framework creation.\nDEVICE_DIR=${BUILD_ROOT}/${CONFIGURATION}-iphoneos/${FMK_NAME}.framework\nSIMULATOR_DIR=${BUILD_DIR}/${CONFIGURATION}-iphonesimulator/${FMK_NAME}.framework\n# -configuration ${CONFIGURATION}\n# Clean and Building both architectures.\n#xcodebuild -configuration \"Release\" -target \"${FMK_NAME}\" -sdk iphoneos build\n#xcodebuild -configuration \"Release\" -target \"${FMK_NAME}\" -sdk iphonesimulator build\n# Cleaning the oldest.\nif [ -d \"${INSTALL_DIR}\" ]\nthen\nrm -rf \"${INSTALL_DIR}\"\nfi\nmkdir -p \"${INSTALL_DIR}\"\n\n# Create iPhone framework only\ncp -R \"${DEVICE_DIR}/\" \"${INSTALL_DIR}/\"\n#lipo -create \"${DEVICE_DIR}/${FMK_NAME}\" -output \"${INSTALL_DIR}/${FMK_NAME}\"\n\n# Create simulator framework only\ncp -R \"${SIMULATOR_DIR}/\" \"${INSTALL_DIR}/\"\n#lipo -create \"${SIMULATOR_DIR}/${FMK_NAME}\" -output \"${INSTALL_DIR}/${FMK_NAME}\"\n\n# Uses the Lipo Tool to merge both binary files (i386 + armv6/armv7) into one Universal final product.\n# Create iPhone and simulator framework both\ncp -R \"${DEVICE_DIR}/\" \"${INSTALL_DIR}/\"\nlipo -create \"${DEVICE_DIR}/${FMK_NAME}\" \"${SIMULATOR_DIR}/${FMK_NAME}\" -output \"${INSTALL_DIR}/${FMK_NAME}\"\n\n# Create document\nDOC_DIR=${SRCROOT}/../Products/${CONFIGURATION}/document\nSRC_DIR=${SRCROOT}/../Source\n\n#rm -rf $DOC_DIR\n#appledoc --no-create-docset --project-name \"charmlive\" --project-company \"charmlive-company\" --company-id \"net.qdating.livestream\" --exit-threshold 2 --output \"${DOC_DIR}\" \"${SRC_DIR}/Common/LiveModule.h\"\n\n#open \"${INSTALL_DIR}\"\n";
